        vk.beta2 = Pairing.G2Point([uint256(9848845522144452977287109854827548271020323755349223923677497727260748594402), uint256(5225501423382825646949978496203840067602435400244912211374286372049843834740)], [uint256(5741572412606261246310262098088767209437242604601009581689612899580027952887), uint256(14422920202449625259291902161478060581825165517466905936786627434927448883027)]);
        vk.gamma2 = Pairing.G2Point([uint256(617107488294255314780377281081330313864180386253356180980066006608504061678), uint256(16509349923608492353667746136151255815082202226625182580751225997711888567372)], [uint256(1044686271277752454105827762062423114753638337215332089942621312122802534101), uint256(9307841570751826806423296722888031782839629125171111475196532374574451794554)]);
        vk.delta2 = Pairing.G2Point([uint256(9864153809196176377608414676888948390856346048815115385996690699764701866284), uint256(7143082743058718690414100983397143170709338411622092271449261147220745840395)], [uint256(19462024662316830388742906805231975522554652573167398355054048180657491897955), uint256(1321755662489900264162796303466189783441720298321722799752770992058901181790)]);
    }


    // accumulate scalarMul(mul_input) into q
    // that is computes sets q = (mul_input[0:2] * mul_input[3]) + q
    function accumulate(
        uint256[3] memory mul_input,
        Pairing.G1Point memory p,
        uint256[4] memory buffer,
        Pairing.G1Point memory q
    ) internal view {
        // computes p = mul_input[0:2] * mul_input[3]
        Pairing.scalar_mul_raw(mul_input, p);

        // point addition inputs
        buffer[0] = q.X;
        buffer[1] = q.Y;
        buffer[2] = p.X;
        buffer[3] = p.Y;

        // q = p + q
        Pairing.plus_raw(buffer, q);
    }

    /*
     * @returns Whether the proof is valid given the hardcoded verifying key
     *          above and the public inputs
     */
    function verifyProof(
        uint256[2] memory a,
        uint256[2][2] memory b,
        uint256[2] memory c,
        uint256[2] memory commit,
        uint256[31] memory input
    ) public view returns (bool r) {

        Proof memory proof;
        proof.A = Pairing.G1Point(a[0], a[1]);
        proof.B = Pairing.G2Point([b[0][0], b[0][1]], [b[1][0], b[1][1]]);
        proof.C = Pairing.G1Point(c[0], c[1]);
        proof.Commit = Pairing.G1Point(commit[0], commit[1]);

        // Make sure that proof.A, B, and C are each less than the prime q
